#include <iostream>
#include <vector>
#include <string>
#include <algorithm>
using namespace std;

string minWindow(string s, string t) {
	int s_num = s.size(), t_num = t.size(), kinds = 0;
	vector<vector<int>> hash(128, vector<int>(2));

	for (int i = 0; i < t_num; i++) {
		++hash[t[i]][0];
		if (hash[t[i]][0] == 1) ++kinds;
	}

	int left = 0, right = 0, temp = 0;
	int min_len = INT_MAX, begin = -1;
	while (right <= s_num - 1) {
		++hash[s[right]][1];
		if (hash[s[right]][1] == hash[s[right]][0]) {
			++temp;
		}

		while (temp == kinds) {
			if (min_len > right - left + 1) {
				min_len = right - left + 1;
				begin = left;
			}

			if (hash[s[left]][0] == hash[s[left]][1]--) {
				--temp;
			}
			++left;
		}
		++right;
	}
	return begin == -1 ? "" : s.substr(begin, min_len);
}

int main() {
	string s = "", t = "aAbBcCdDeEfFgGhHiIjJkKlLmMnNoOpPqQrRsStTuUvVwWxXyYzZ";
	string return_str = minWindow(s, t);
	cout << return_str << endl;
	return 0;
}